The Wannsee Conference

History Documentary with no narration published by ORF in 1984 - German language


Information
------------------------------

A startling re-creation of a Nazi meeting that determined the &quot;final solution&quot; for six million Jews.
On January 20, 1942. 14 members of of Hitler's hierarchy - leaders of the SS, the Nazi Party, Justice Ministry, industry and transport, the state apparatus and lords of enslaved territories - met in the posh Berlin suburb of Wannsee. These elite officials of the Third Reich gathered in utter secrecy for 85 minutes to discuss the ways and means, technology and logistics, of effecting the &quot;Final Solution to the Jewish Problem.&quot; The meeting went smoothly. Reinhard Heydrich, chief of the Nazi Security Police and Secret Service, expected to meet some resistance to plans for &quot;Final Solution.&quot; There was none.
Producer Manfred Korytowski painstakingly researched THE WANNSEE CONFERENCE from the original secretary's notes and reconstructed the meeting in virtually real time. The result is serious and startling.

Produced by Manfred Korytowski
Directed by Heinz Schirk
Screenplay by Paul Mommertz

